import { combineReducers } from "redux";
import storiesReducer from './stories'; // Make sure to import your stories reducer correctly

const rootReducer = combineReducers({
  stories: storiesReducer, // storiesReducer is the valid reducer function
  // Other reducers can be added here as well
});

export default rootReducer;
